    "Nitrous Oxide Fuel Blend-Continuous Operation Lunar Thruster (NOFB-COLT) Project",nt"tracking_summary":
    {ntt"total": 2,ntt"recent": 1nt},nt"groups": [],nt"relationships_as_subject":
    [],nt"revision_timestamp": "2015-05-06T21:48:45.187100",nt"name": "nitrous-oxide-fuel-blend-continuous-operation-lunar-thruster-nofb-colt-project",nt"isopen":
    true,nt"url": null,nt"notes": "We propose conducting further development
    for a Nitrous Oxide Fuel Blend (NOFB) propulsion system.  Phase I activities will
    concentrate on a revising a previous 5 lbf thruster to facilitate continuous operation
    with repeated restart.  The thruster will utilize a novel new NOFB monopropellant.
     NOFB series monopropellant formulations have the following characteristics: 1)
    Non-toxic and readily manufacturable; 2) Vacuum specific impulse of 310+s (compared
    to monopropellant hydrazine's 235s); 3) Space-storable with wide temperature storage
    limits from &lt;-77 C to &gt;100 C; 4) High storage density at equivalent to twice
    as dense as monopropellant hydrazine depending on temperature; 5) Potentially highly
    throttleable due to very fast reaction kinetics; and 6) Self-pressurizing thereby
    simplifying the overall feed system architecture and reliability.  Due to these
    desirable characteristics of NOFB monopropellants, Phase I funding is requested
    from the NASA SBIR program.",nt"license_title": "U.S. Government Work",nt"extras":
